import './css/style.css';

const Header = () => {
  return (
    <div className="header">
    <h1>Hello World</h1>
    <Nav />
    </div>
  );
}

const Nav = () => {
  return ( 
    <nav>
      <ul>
        <li><a href='#'>CSS</a></li>
        <li><a href='#'>JS</a></li>
        <li><a href='#'>REACT</a></li>
      </ul>
    </nav>
  );
}

export default Header;
